 ** *HWBaseGrossPrice (SystemAdditionalData) shall be filled with ProductPriceIncTax (from CommercialDetails of Device from PCAT)*
 ** HWDiscountsList shall be filled with
 *** Discount = {color:#ff8b00}0,00 (To be hardcoded into the system based on business confirmation){color}
 *** Condition = example {color:#ff8b00}ZVFA (derived from PCAT){color}
 *** Price list = example {color:#ff8b00}03 (derived from PCAT){color}
